pragma solidity >=0.5.0;


contract ExampleStorage {

    struct Clashes {
        string stringOne;
        string stringTwo;
    }

    mapping (uint256 => Clashes) public clashes;
    mapping (bytes32 => bool) public clashStored;
    uint256 public numClashes;

    function storeByte4Clash(string memory a, string memory b)
    public {
        require(checkClash(a, b));
        require(!checkClashStored(a,b));
        clashStored[keccak256(abi.encodePacked(a, b))] = true;
        Clashes storage newClash = clashes[numClashes++];
        newClash.stringOne = a;
        newClash.stringTwo = b;
    }

    function checkClashStored(string memory a, string memory b)
    public
    view
    returns (bool) {
        return clashStored[keccak256(abi.encodePacked(a,b))];
    }

    function checkClash(string memory a, string memory b)
    public
    pure
    returns (bool) {
        return bytes4(keccak256(abi.encodePacked(a))) == bytes4(keccak256(abi.encodePacked(b)));
    }

    function getClashes(uint256 index)
    public
    view
    returns (string memory, string memory ){
        return (clashes[index].stringOne, clashes[index].stringTwo);
    }

}

contract ExampleStorage2 is ExampleStorage {

    function storeByte4Clash(string memory a, string memory b)
    public {
        require(bytes(a).length < 100);
        require(bytes(b).length < 100);
        require(checkClash(a, b));
        require(!checkClashStored(a,b));
        clashStored[keccak256(abi.encodePacked(a, b))] = true;
        Clashes storage newClash = clashes[numClashes++];
        newClash.stringOne = a;
        newClash.stringTwo = b;
    }
}
